from PyQt5 import QtGui
import base64
import os

def Get_icon(image_str):
    ImageStr = base64.b64decode(image_str)
    with open("icon.ico", "wb") as icon_text:
        icon_text.write(ImageStr)
    icon_text.close()
    return(QtGui.QIcon("icon.ico"))
        
def Remove_icon():
    os.remove("icon.ico")
    return 0
        
